import React from 'react'
import CheckIcon from '@mui/icons-material/Check';


const CheckIcons = () => {
    return (
        <div style={{width: 30, height: 30, borderRadius: '50%', display:'flex', justifyContent:'center', alignItems:'center', border:'1px solid black'}}>
        <CheckIcon/>
        </div>
    )
}

export default CheckIcons
